- input: "TEXT\x1CC00196444\x1CMFEC-301633\x1C\x1CF3XA\x1CAs a result of an internal
    audit, we discovered that the Committee's reported Baginning Cash on Hand balance
    as of January 1, 2004 was incorrect due to a software conversion.  At the time
    of the filing, the Committee disclosed all of the receipt and disbursement information
    in its possession at the time.  However, our audit has made us aware of a PAC
    to PAC disbursement for $125,000 that was not originally reported due to human
    error.  Additionally, bank charges were not originally reported making this amendment
    necessary.  Since the audit, the Committee has changed its internal controls to
    avoid these oversights and the employee is no longer employed by the sponsoring
    organization. "
